import React from 'react';
import Tracks from '../tracks/Tracks';
import Search from '../tracks/Search';
function Index() {
    return (
        <React.Fragment>
        <br/><p></p>
            <Search />
            <Tracks />
        </React.Fragment>
    )
}

export default Index;
